import './Header.css'
const Header= ()=>{

    return (
        <header className="flex-header">
            <h3 className="Nav-title">Title</h3>
            <nav>
        <ul className="flex-ul">
            <li>First Link</li>
            <li>Second Link</li>
        </ul>
        <ul className="flex-ul">
            <li>
                abc
